import Link from 'next/link'

export default function Index() {
  return (
    <div>
      <p className="eliza">Eliza,</p>
      <p className="question">¿Quieres ser mi novia?</p>
      <div className="links">
        <Link href="/yes">
          <a>Sí</a>
        </Link>
        <Link href="/yes">
          <a>Yes en inglés</a>
        </Link>
      </div>
      <style jsx global>{`
        html {
          height: 100%;
          width: 100%;
          overflow: hidden;
        }

        body {
          margin: 0;
          padding: 1rem 2rem;
          background: rgb(2,0,36);
background: linear-gradient(90deg, rgba(2,0,36,1) 14%, rgba(168,166,15,1) 100%, rgba(52,88,46,1) 100%);
          color: white;
          display: flex;
          justify-content: center;
          align-items: center;
          height: 100%;
        }

        .eliza, .question {
          margin: 0;
          font-size: 100px;
          text-align left;
          max-width: 100%;
        }

        .question {
          font-size: 80px;
        }

        .links {
          width: 100%;
          display: flex;
          justify-content: center;
          align-items: center;
          margin-top: 2rem;
        }

        .links a {
          font-size: 20px;
          color: white;
          text-decoration: none;
          margin: 0 1rem;
          font-family: 'Helvetica';
          font-weight: bold;
        }

      `}</style>
    </div>
  )
}
